import React from 'react';
import ReactDOM from 'react-dom';

function Card(){
    return(
        <>
        <div className="cards">
            <div className="card">
                <img src='https://images-na.ssl-images-amazon.com/images/I/51Y-4b1Ux0L._SY450_.jpg' alt='Internet connection jaali hai tera'></img>
                <div className="card-info">
                    <span className="card-category">A Netflix Original Series</span>
                    <h3 className='card-title'>DARK</h3>
                    <a href="https://www.netflix.com/in/title/80100172" target="_chutki">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    </>

    )
}

ReactDOM.render(
    
    document.getElementById('root')
)
